export default async function getSpotifyData(year) {
	try {
		const response = await fetch(`/stfyat?year=${year}`);

		if (!response.ok) {
			throw new Error('Failed to fetch');
		}

		const playlistResponse = await response.json();
		return playlistResponse
	}
	catch (error) {
		console.error(error);
	}
}
